import React, { Component } from 'react'
import {ListGroup,ListGroupItem} from 'react-bootstrap'

export default class List extends Component {
  render() {
    return (
      <div>
        <ListGroup id="PlayersList">
        {this.props.mainstate.players.map((player,index)=><ListGroupItem><span>{index+1}.&nbsp;Name:{player.value}&nbsp;Rating:{player.rating} </span></ListGroupItem> )}
        </ListGroup>;
      </div>
    )
  }
}
